import './App.css';
import { Jogos } from './components/pages/Jogos.js';
import { Card } from './components/shared/Card/Card';
import { Header } from './components/shared/Header/Header';

function App() {
  const jogos = Jogos;

  return (
    <section>

      <Header />
      <main>
      {jogos.map((card, index) => (
        <Card
          key={index}
          img={card.img}
          desconto={`${(card.desconto * 100)}%`}
          precoOrig={card.precoOrig}
          price={card.desconto * card.precoOrig}
        />
      ))}
      </main>
    </section>
  );
}

export default App;
